import React from 'react'; 
import 
{
  BrowserRouter as Router, Route, Switch, Link, Redirect
} 
from 'react-router-dom'; 

//Pages
import MainPage from './pages/MainPage';

function App()  {
  return (
    <Router>
      <Route path="/login" component = {MainPage}></Route>
    </Router>
  );
}

export default App;
